import React from "react";
import Machine from "./Machine";
import './MG.css';

function MG(props) {
  return (
    <div className="MG">
      {props.mg.map((ele) => (
        <div key={ele.id} className="machinesWrapper" style={{ textAlign: "center" }}>
          <h4>{ele.name}</h4>
          <Machine machine={ele.machines} />
        </div>
      ))}
    </div>
  );
}

export default MG;
